import { login } from '@store/reducers/user';
import React from 'react';
import { useDispatch } from 'react-redux';

const Index = () => {
    const dispatch = useDispatch();

    const handleClick = () => {
        dispatch(login('welcome'));
    };

    return (
        <div className="w-full flex justify-center items-center h-screen bg-purple-400 text-white font-bold">
            hello docker ssusss
            <button className="p-2 rounded bg-red" onClick={handleClick}>
                Login
            </button>
        </div>
    );
};

export default Index;
